import React from "react";
import MapSVG from "../assets/map.svg";
import { Avatar } from "@mui/material";

const Map = () => {
  return (
    <div className='relative'>
      <div className='absolute bottom-0 left-0 h-8 w-8 rounded-full bg-rose-600'></div>
      <img src={MapSVG} alt='' width={500} />
    </div>
  );
};

export default Map;
